import React from "react";

export default function Note(props) {

  function handleClick(){
    props.onDelete();
    event.preventDefault();
  }
  return (
    <div className="note">
      <h1> {props.title} </h1>
      <p> {props.content} </p>
      <button onClick={handleClick}>DELETE</button>
    </div>
)}
